commits.content:
.page {
  &--second {
  padding-top: 32px;
  padding-bottom: 100px;
  }

  &__title3 {
font-family: Cinzel sans-serif;
font-size: 24px;
font-weight: 700;
line-height: 30px;
letter-spacing: 0px;
text-align: left;
  }

  &__textcols {
    display: flex;
    flex-wrap: nowrap;
    gap: 24px;
    padding-top: 16px;

    &-time {
      font-family: Cinzel;
      font-size: 16px;
      font-weight: 700;
      line-height: 27px;
      letter-spacing: 0px;
      text-align: left;
    }

    &-days {
      font-family: Cinzel;
      font-size: 16px;
      font-weight: 400;
      line-height: 27px;
      letter-spacing: 0px;
      text-align: left;
    }
  }

  &__title4 {
    font-family: Cinzel;
    font-size: 16px;
    font-weight: 700;
    line-height: 27px;
    letter-spacing: 0px;
    text-align: left;
  }

  &__text-normal {
    font-family: Cinzel;
    font-size: 16px;
    font-weight: 400;
    line-height: 27px;
    letter-spacing: 0px;
    text-align: left;
    padding-top: 16px;
  }

  &.title--section {
    font-family: Cinzel;
font-size: 32px;
font-weight: 700;
line-height: 32px;
letter-spacing: -1.5px;
text-align: center;
padding: 0;
  }

  &__text-norm {
    font-family: Cinzel;
    font-size: 16px;
    font-weight: 400;
    line-height: 27px;
    letter-spacing: 0px;
    text-align: center;
    padding-top: 8px;
  }
}
